import React from "react";
import "./index.css";

const App = () => {
  return (
    <>
      <div>
        <h1>Hello</h1>

        <input type="text" placeholder="Enter Your Age" />
        <button>Find Age</button>
      </div>
    </>
  );
};

export default App;
